import React, { useState, useEffect } from "react";
import classes from "./styles/Projects.module.css";
import "./styles/cards.css";
import Target_icon from "../assets/target_icon.png";
const Wheel = ({card}) => {
  console.log(card);
  return (
    <>
      <div className={classes.wheels} id="project"></div>
      <a href="/" className={classes.btn}>
        Projects
      </a>
      {card[0] && <><div className={classes.cards} id="card1">
        <p id="c_title1">{card[0].name}</p>
      </div>
      <div className={classes.cards} id="card2">
        <img src={Target_icon} alt="active card" id="target_icon"></img>
        <p id="c_title2">{card[1].name}</p>
      </div>
      <div className={classes.cards} id="card3">
        <p id="c_title3">{card[2].name}</p>
      </div>
      <div className={classes.cards} id="card4">
        <p id="c_title4">{card[3].name}</p>
      </div></>}
    </>
  );
};

export default Wheel;
